select FED_UNIQUE_NAME, SF_LOAD_TS_EST, TIME, zeroifnull(SMFCC_NSMF_PDU_SESSION_CREATE_SM_CONTEXT_ATTEMPTS), zeroifnull(SMFCC_NSMF_PDU_SESSION_CREATE_SM_CONTEXT_SUCCESSES), 
zeroifnull(SMFCC_NSMF_PDU_SESSION_UPDATE_SM_CONTEXT_ATTEMPTS), zeroifnull(SMFCC_NSMF_PDU_SESSION_UPDATE_SM_CONTEXT_SUCCESSES)
from MOBILITYCORE.MOB_PM_CORE_METRICS_5G_NORTHRIM.SMFCC_INTERFACE where substr(FED_UNIQUE_NAME, 1, 7) in (select substr(SITE, 1, 7) from MOBILITYCORELOCAL.MSLOGS.SPOTLIGHT_SITES)
